import { Fragment } from "react";
import Header from "./components/Layout/Header";
import Meals from "./components/Meals/Meals";
function App() {
  return (
    <div>
      <h2>
        <Fragment>
          <Header />
          <Meals />
        </Fragment>
      </h2>
    </div>
  );
}

export default App;
